          <p class="project_title">Le Français dans ma ville</p>
          <div data-scroll data-scroll-direction="vertical" data-scroll-speed="-1" class="project_description">
            <p class="en">"Le français dans ma ville" (French in my town) is an urban learning path generator designed to combat illiteracy and technological illiteracy. The project was developed in collaboration with the Plateforme d'accès au Français du Vaucluse.</p>
            <p class="fr">"Le français dans ma ville" est un generateur de parcours urbains destinés à lutter contre l'illettrisme et l'illectronisme. Projet réalisé en collaboration avec la Plateforme d'accès au Français du Vaucluse.</p>
            <p class="pt">"Le français dans ma ville" (O francês na minha cidade) é um gerador de percursos de aprendizagem urbanos concebido para combater a iliteracia e o analfabetismo. O projeto foi desenvolvido em colaboração com a Plateforme d'accès au Français du Vaucluse.</p>
            <img src="./img/lfdmv.png" alt="Project 'Le Français dans ma ville'"class="project_photo">
          </div>
          <!-- <h2><span data-scroll data-scroll-direction="horizontal" data-scroll-speed="-2">Project 1</span> <span data-scroll data-scroll-direction="horizontal" data-scroll-speed="1">Project name</span></h2> -->
