        <div class="inner-section center">
          <div class="background"></div>
          <p class="project_title translateY">AirsoftMapper</p>
          <div data-scroll data-scroll-direction="vertical" data-scroll-speed="-1" class="project_description">
            <img src="./img/AirsoftMapper.png" alt="Project 'AirsoftMapper'"class="project_photo">
            <p class="en">AirsoftMapper is a platform where airsoft players can connect with other teams, explore new fields and share photos and comments.</p>
            <p class="fr">Plateforme permettant aux joueurs d'airsoft de rencontrer d'autres équipes et de découvrir de nouveaux terrains, de partager des photos et des commentaires.</p>
            <p class="pt">AirsoftMapper é uma plataforma onde os jogadores de airsoft podem encontrar outras equipas, descobrir novos terrenos e partilhar fotografias e comentários.</p>
          </div>
        </div>
        
        <div class="inner-section">
          <div class="background"></div>
          <p class="project_title translateY">Tetris remake</p>
          <div data-scroll data-scroll-direction="vertical" data-scroll-speed="-1" class="project_description">
            <p class="en">Remake of the famous game Tetris. This project, entirely in Javascript, was realised at the end of my learning course.</p>
            <p class="fr">Remake du célèbre jeu Tetris. Ce projet, entièrement en Javascript, a été réalisé à la fin de mon parcours de formation.</p>
            <p class="pt">Remake do famoso jogo Tetris. Este projeto,inteiramente em Javascript, foi realizado no final do meu percurso de formaçao.</p>
            <img src="./img/tetris.png" alt="Project 'Tetris Remake'"class="project_photo">
          </div>
        </div>

        <div class="inner-section center">
        <div class="background"></div>
        <p class="project_title translateY">Dragon Ball Memory game</p>
          <div data-scroll data-scroll-direction="vertical" data-scroll-speed="-1" class="project_description">
            <img src="./img/jeux-memoire.png" alt="Project 'Jeux de la memoire Dragon Ball'"class="project_photo">
            <p class="en">Dragon Ball memory game. First genuine Javascript experience. A new version with a choice of theme and different difficulty levels is coming soon.</p>
            <p class="fr">Jeu de mémoire Dragon Ball. Première véritable expérience en Javascript. Une nouvelle version avec un choix de thème et différents niveaux de difficulté est à venir.</p>
            <p class="pt">Jogo da memoria em versão Dragon Ball. Primeira verdadeira experiência em Javascript. Uma nova versão com escolha do tema e diversos niveis de dificuldade prevista brevemente.</p>
          </div>
        </div>
        
        <div class="inner-section">
